DROP TABLE IF EXISTS "Media";
CREATE TABLE Media (
  Path         text 			NOT NULL ON CONFLICT IGNORE UNIQUE ON CONFLICT REPLACE,
  Artist       varchar(50),
  Album        varchar(50),
  Title        varchar(50),
  TrackNumber  int,
  Year         integer,
  Duration     varchar(10),
  Rank         integer
);
DROP TABLE IF EXISTS "Settings";
CREATE TABLE "Settings" ("param" TEXT, "value" TEXT);
